import React, { useState } from 'react';
import { Form, Button, Alert } from 'react-bootstrap';
import axios from 'axios';

const RegistrationForm = () => {
  const [fullName, setFullName] = useState('');
  const [contactNumber, setContactNumber] = useState('');
  const [email, setEmail] = useState('');
  const [day, setDay] = useState('');
  const [month, setMonth] = useState('');
  const [year, setYear] = useState('');
  const [password, setPassword] = useState('');
  const [confirmPassword, setConfirmPassword] = useState('');
  const [validated, setValidated] = useState(false);
  const [alertVariant, setAlertVariant] = useState('');
  const [alertMessage, setAlertMessage] = useState('');

  const handleFullNameChange = (event) => {
    setFullName(event.target.value);
  };

  const handleContactNumberChange = (event) => {
    setContactNumber(event.target.value);
  };

  const handleEmailChange = (event) => {
    setEmail(event.target.value);
  };

  const handleDayChange = (event) => {
    setDay(event.target.value);
  };

  const handleMonthChange = (event) => {
    setMonth(event.target.value);
  };

  const handleYearChange = (event) => {
    setYear(event.target.value);
  };

  const handlePasswordChange = (event) => {
    setPassword(event.target.value);
  };

  const handleConfirmPasswordChange = (event) => {
    setConfirmPassword(event.target.value);
  };

  const handleSubmit = (event) => {
    const form = event.currentTarget;
    event.preventDefault();
    event.stopPropagation();
    if (form.checkValidity() === true) {
      const dateOfBirth = `${day}-${month}-${year}`;
      const data = {
        full_name: fullName,
        contact_number: contactNumber,
        email: email,
        date_of_birth: dateOfBirth,
        password: password,
      };
      axios
        .post('https://fullstack-test-navy.vercel.app/api/users/create', data)
        .then((response) => {
          setAlertVariant('success');
          setAlertMessage(response.data.title);
        })
        .catch((error) => {
          setAlertVariant('danger');
          setAlertMessage(error.response.data.title);
        });
    }
    setValidated(true);
  };

  return (
    <div className='container'>
      <h1 className='text-center'>Registration Form</h1>
      <Form noValidate validated={validated} onSubmit={handleSubmit}>
        <Form.Group controlId='formFullName'>
          <Form.Label>Full Name</Form.Label>
          <Form.Control
            required
            type='text'
            placeholder='Enter full name'
            value={fullName}
            onChange={handleFullNameChange}
            pattern='^[a-zA-Z ]+$'
          />
          <Form.Control.Feedback type='invalid'>
            Please provide a valid full name with no symbols.
          </Form.Control.Feedback>
        </Form.Group>

        <Form.Group controlId='formContactNumber'>
          <Form.Label>Contact Number</Form.Label>
          <Form.Control
            required
            type='tel'
            placeholder='Enter contact number'
            value={contactNumber}
            onChange={handleContactNumberChange}
            pattern='^\d{3}-\d{3}-\d{4}$'
          />
          <Form.Control.Feedback type='invalid'>
            Please provide a valid Canadian phone number in the format XXX-XXX-XXXX.
          </Form.Control.Feedback>
        </Form.Group>

        <Form.Group controlId='formEmail'>
      <Form.Label>Email</Form.Label>
      <Form.Control
        required
        type='email'
        placeholder='Enter email'
        value={email}
        onChange={handleEmailChange}
      />
      <Form.Control.Feedback type='invalid'>
        Please provide a valid email address.
      </Form.Control.Feedback>
    </Form.Group>

    <Form.Group controlId='formDateOfBirth'>
      <Form.Label>Date of Birth</Form.Label>
      <Form.Row>
        <Form.Group controlId='formDay' className='col-md-4'>
          <Form.Control
            required
            as='select'
            value={day}
            onChange={handleDayChange}
          >
            <option value=''>Day</option>
            {Array.from({ length: 31 }, (_, i) => i + 1).map((day) => (
              <option key={day} value={day}>
                {day}
              </option>
            ))}
          </Form.Control>
          <Form.Control.Feedback type='invalid'>
            Please provide a valid day of the month.
          </Form.Control.Feedback>
        </Form.Group>

        <Form.Group controlId='formMonth' className='col-md-4'>
          <Form.Control
            required
            as='select'
            value={month}
            onChange={handleMonthChange}
          >
            <option value=''>Month</option>
            {[
              'January',
              'February',
              'March',
              'April',
              'May',
              'June',
              'July',
              'August',
              'September',
              'October',
              'November',
              'December',
            ].map((month) => (
              <option key={month} value={month}>
                {month}
              </option>
            ))}
          </Form.Control>
          <Form.Control.Feedback type='invalid'>
            Please provide a valid month of the year.
          </Form.Control.Feedback>
        </Form.Group>

        <Form.Group controlId='formYear' className='col-md-4'>
          <Form.Control
            required
            type='number'
            placeholder='Year'
            value={year}
            onChange={handleYearChange}
            min={new Date().getFullYear()}
          />
          <Form.Control.Feedback type='invalid'>
            Please provide a valid future year.
          </Form.Control.Feedback>
        </Form.Group>
      </Form.Row>
    </Form.Group>

    <Form.Group controlId='formPassword'>
      <Form.Label>Password</Form.Label>
      <Form.Control
        required
        type='password'
        placeholder='Enter password'
        value={password}
        onChange={handlePasswordChange}
        pattern='^(?=.*[a-z])(?=.*[A-Z])(?=.*\d)[a-zA-Z\d]{8,}$'
      />
      <Form.Control.Feedback type='invalid'>
        Password must contain at least 8 characters, including at least one uppercase letter, one lowercase letter, and one number.
      </Form.Control.Feedback>
    </Form.Group>

    <Form.Group controlId='formConfirmPassword'>
      <Form.Label>Confirm Password</Form.Label>
      <Form.Control
        required
        type='password'
        placeholder='Confirm password'
        value={confirmPassword}
        onChange={handleConfirmPasswordChange}
        pattern={password}
      />
      <Form.Control.Feedback type='invalid'>
        Please confirm your password.
      </Form.Control.Feedback>
    </Form.Group>

    <Button
      variant='primary'
      type='submit'
    >
      Submit
    </Button>
  </Form>
  {alertMessage && (
    <Alert variant={alertVariant} className='mt-3'>
      {alertMessage}
    </Alert>
  )}
</div>
);
};

export default RegistrationForm;
